import React from 'react';
import '../stylesheets/home.css';
import { ReactReduxContext } from 'react-redux'


const Tasks = (store) => store.map(i => {
    <li>{i}</li>
})

function Home() {
    return (
        <ReactReduxContext.Consumer>
        <div className="home">
            <ol>
                {Tasks}
            </ol>

        </div>
        </ReactReduxContext.Consumer>
    );
}

export default Home;
